import { StyleSheet } from 'react-native';

const Fonts = StyleSheet.create({
    titleLarge: {
        color: 'rgba(240,175,77,1)',
        fontWeight: 'bold',
        fontSize: 50,
    },
    titleMedium: {
        color: 'rgba(141,69,85,1)',
        fontWeight: 'bold',
        fontSize: 17,
    },
    textBoldSmall: {
        fontWeight: 'bold',
        fontSize: 14,
    },
    textSmall: {
        fontSize: 12,
    },
    textButton: {
        fontWeight: 'bold',
        color: 'black',
    },
});

export default Fonts;
